import React, { createContext, useContext, useReducer } from 'react';


const initialState = {
    count: 0,
  };

const reducer = (state, action) => {
    switch (action.type) {
      case 'WATER_INCREMENT':
        return {
            count: state.count + 1
        };


      case 'VEGETATION_INCREMENT':
        return {
         count: state.count + 20
        };
      default:
        return state;
    }
  };
